import React from 'react';
import LoginWithGoogle from "./googleLogin";


function Home(props){
    return(
        <div className="container text-center row">
            <div className="container d-flex m-auto">
           <LoginWithGoogle className="col-lg-6"></LoginWithGoogle>
            <button className="btn-lg btn-primary col-lg-6">Login</button>
            </div>
        </div> 
    )
}

export default Home;
